import React, { useState } from "react";
import "./css/nav.css";
function Nav() {
  return (
    <div className="nav">
      <h1>GAMING HUB</h1>
      <div>
        <button>HOME</button>
        <button>UPCOMMING MATCHES</button>
        <button>RESULT</button>
      </div>
      <div>
        <button>PROFILE</button>
      </div>
    </div>
  );
}
export default Nav;
